import MainNavigation from '../components/navigation/mainNavigation';
import ProjectDirectory from '../components/directory/projectDirectory'

const ProjectList = () => {
  return (
    <div>
      <MainNavigation/>
      <div className='project-container'>
        <ProjectDirectory/>
      </div>
    </div>
  );
};

export default ProjectList;
